import React from "react";
import BookComponent from "./BookComponent"
class BookListComponent extends React.Component {
  state = {
  }


  componentDidMount() {
    this.setState(
      {
        Title: this.props.Title,
        BookList: this.props.BookList
      }
    )
  }

  render() {
    return (
      <div className="bookshelf">
        <h2 className="bookshelf-title">{this.state.Title}</h2>
        <div className="bookshelf-books">
          <ol className="books-grid">
            {this.state.BookList.map(function (book, i) {
              return <p>{book.title}</p>
            })}
            <li>
              <BookComponent Title="Tommy" Authors="Tommy Vadman" Shelf="wantToRead" Cover="http://books.google.com/books/content?id=yDtCuFHXbAYC&printsec=frontcover&img=1&zoom=1&imgtk=AFLRE72RRiTR6U5OUg3IY_LpHTL2NztVWAuZYNFE8dUuC0VlYabeyegLzpAnDPeWxE6RHi0C2ehrR9Gv20LH2dtjpbcUcs8YnH5VCCAH0Y2ICaKOTvrZTCObQbsfp4UbDqQyGISCZfGN&source=gbs_api"></BookComponent>
            </li>
            <li>
              <BookComponent Title="Tommy" Authors="Tommy Vadman" Shelf="wantToRead" Cover="http://books.google.com/books/content?id=yDtCuFHXbAYC&printsec=frontcover&img=1&zoom=1&imgtk=AFLRE72RRiTR6U5OUg3IY_LpHTL2NztVWAuZYNFE8dUuC0VlYabeyegLzpAnDPeWxE6RHi0C2ehrR9Gv20LH2dtjpbcUcs8YnH5VCCAH0Y2ICaKOTvrZTCObQbsfp4UbDqQyGISCZfGN&source=gbs_api"></BookComponent>
            </li>
          </ol>
        </div>
      </div>
    )
  }
}

export default BookListComponent
